         window.external.IconClick(time, acc_x,acc_y,acc_z,speed,consumption_energy,lost_energy);
     });
     google.maps.event.addListener(marker, 'rightclick', function(event) {
         window.external.IconRightClick(time);
     });
 }
image_center = new google.maps.MarkerImage('../../image/center_marker.gif', new google.maps.Size(25, 25), new google.maps.Point(0, 0), new google.maps.Point(12, 12));

center_marker = new google.maps.Marker({position: map.getCenter(), icon: image_center, zIndex: 400});
center_marker.setMap(map);

}
</script>
